import React, { useState, useEffect } from 'react';
import './App.css';
import DonutLargeIcon from '@material-ui/icons/DonutLarge';
import ChatIcon from '@material-ui/icons/Chat';
import MoreVertIcon from '@material-ui/icons/MoreVert';
import SearchIcon from '@material-ui/icons/Search';
import ChatListItem from './components/ChatListItem';
import Chatintro from './components/Chatintro';
import ChatWindow from './components/ChatWindow'; 
import NewChat from './components/NewChat';
import Login from './components/Login';

function App() {
  const [ chatlist, setChatlist ] = useState([ 
    { chatId: 1, title: 'fulaninho1', image: 'data:image/jpeg;base64,' },
    { chatId: 2, title: 'fulaninho2', image: 'data:image/jpeg;base64,' },
    { chatId: 3, title: 'fulaninho3', image: 'data:image/jpeg;base64,' },
    { chatId: 4, title: 'fulaninho4', image: 'data:image/jpeg;base64,' },
    { chatId: 5, title: 'fulaninho5', image: 'data:image/jpeg;base64,' },
    { chatId: 6, title: 'fulaninho6', image: 'data:image/jpeg;base64,' },
    { chatId: 7, title: 'fulaninho7', image: 'data:image/jpeg;base64,' },
    { chatId: 8, title: 'fulaninho8', image: 'data:image/jpeg;base64,' },
    { chatId: 9, title: 'fulaninho9', image: 'data:image/jpeg;base64,' },
    { chatId: 10, title: 'fulaninho10', image: 'data:image/jpeg;base64,' },
    { chatId: 11, title: 'fulaninho11', image: 'data:image/jpeg;base64,' },
    { chatId: 12, title: 'fulaninho12', image: 'data:image/jpeg;base64,' },
    { chatId: 13, title: 'fulaninho13', image: 'data:image/jpeg;base64,' },
    { chatId: 14, title: 'fulaninho14', image: 'data:image/jpeg;base64,' },
    { chatId: 15, title: 'fulaninho15', image: 'data:image/jpeg;base64,' },
    { chatId: 16, title: 'fulaninho16', image: 'data:image/jpeg;base64,' },
    { chatId: 17, title: 'fulaninho17', image: 'data:image/jpeg;base64,' },
    { chatId: 18, title: 'fulaninho18', image: 'data:image/jpeg;base64,' },
    { chatId: 19, title: 'fulaninho19', image: 'data:image/jpeg;base64,' },
    { chatId: 20, title: 'fulaninho20', image: 'data:image/jpeg;base64,' },
    { chatId: 21, title: 'fulaninho21', image: 'data:image/jpeg;base64,' },
    { chatId: 22, title: 'fulaninho22', image: 'data:image/jpeg;base64,' },
    { chatId: 23, title: 'fulaninho23', image: 'data:image/jpeg;base64,' },
    { chatId: 24, title: 'fulaninho24', image: 'data:image/jpeg;base64,' },
   ]);
  const [ activeChat, setActiveChat ] = useState({}); 
  const [ user, setUser ] = useState({
    id: 123,
    avatar: 'data:image/jpeg;base64,',
    name: 'Marco Aurelio'
  });

  const [ showNewChat, setShowNewChat ] = useState(false);

  const handleNewChat = () => {
    setShowNewChat(true);
  }

  const handleLoginData = async (u) => {
    let newUser = {
      id: u.uid,
      name: u.displayname,
      avatar: u.photoURL
    };
    setUser(newUser);
  }

  if(user === null) {
    return (<Login onReceive = {handleLoginData} />);
  }

  return (
    <div className = 'app-window'>
      
      <div className = 'sidebar'>
        <NewChat chatlist = {chatlist} user = {user} show = {showNewChat} setShow = {setShowNewChat} />
        <header>
          <img className = 'header--avatar' src = {user.avatar} />
          <div className = 'header--buttons'>

            <div className = 'header--btn'>
              <DonutLargeIcon  syle = {{ color: '#919191' }} />
            </div>

            <div onClick = {handleNewChat} className = 'header--btn'>
              <ChatIcon  syle = {{ color: '#919191' }} />
            </div>

            <div className = 'header--btn'>
              <MoreVertIcon  syle = {{ color: '#919191' }} />
            </div>

          </div>
        </header>

        <div className = 'search'>
          < div className = 'search--input'>
            <SearchIcon fontSize = 'small' syle = {{ color: '#919191' }}/>
            <input type = 'search' placeholder = 'Procurar ou comear uma nova conversa' />

          </div>
        </div>

        <div className = 'chatlist'>
          {chatlist.map((item, key) => (
            <ChatListItem 
              key = {key} 
              data = {item}
              active = {activeChat.chatId === chatlist[key].chatId}
              onClick = {() => setActiveChat(chatlist[key])}
            />
          ))}
        </div>


      </div>

      <div className = 'contentarea'>
        {activeChat.chatId !== undefined && 
          <ChatWindow  user = {user} />
        }

        {activeChat.chatId === undefined && 
          <Chatintro />  
        }

      </div>

    </div>
  )
}

export default App;